	"zsandiego/crearreserva/view/DetalleArticulos.fragment.xml":'<core:FragmentDefinition \n    xmlns="sap.m" \n    xmlns:l="sap.ui.layout" \n    xmlns:f="sap.ui.layout.form" \n    xmlns:pc="zsandiego.crearreserva.control"\n    xmlns:core="sap.ui.core"><Dialog id="DetalleArticuloDialog" title="Detalle del Material - {cartEntry>Itetx}"><l:Grid defaultSpan="L12 M12 S12" width="auto" id="idGrid"><l:content><f:SimpleForm id="formDetalle" editable="true" layout="ResponsiveGridLayout" labelSpanXL="4" labelSpanL="4" labelSpanM="12"\n\t\t\t\t\tlabelSpanS="12" adjustLabelSpan="false" emptySpanXL="0" emptySpanL="0" emptySpanM="0" emptySpanS="0" columnsXL="2" columnsL="2" columnsM="1"\n\t\t\t\t\tsingleContainerFullSize="false"><f:content><Label required="true" text="Clase de pedido"/><Input id="idClasepedidoDetalle" enabled="false" value="{cartProducts>/lineaCabeceraDetalle/AsignacionDetalle}"/><Label  text="{i18n>cantidad}"/><StepInput\n                                id="sInpQuantity"\n                                min="{= parseInt(${cartEntry>Cant_Min})}"\n                                value="{cartEntry>Quantity}"\n                                valueStateText="Ingrese la cantidad a añadir"\n                                valueState="Information"></StepInput><Label  text="{i18n>centro}"/><pc:InputValueHelp \n                            id="idfragcentro"\n                            placeholder="Selecciona un centro"\n                            value="{cartEntry>Werks}"\n                            showValueHelp="true"\n                            afterChange="imputacionChange"\n                            showSuggestion="true"\n                            helpModel="localmodel" \n                            helpEntitySet="ZCDSMM_WERKS_TXT" \n                            helpDescriptionField="name1" \n                            helpKeyField="werks"\n                            dialogTitle="{i18n>centro}"\n                        /><Label  text="Tipo de Imputación"/><ComboBox id="cbTipoImputacion" change="imputacionChange" selectedKey="{cartEntry>Knttp}"\n\t\t\t\t\t\t\titems="{\n\t\t\t\t\t\t\t\tpath: \'localmodel>/ZCDSMM_KNTTP_TXT\'\n\t\t\t\t\t\t\t}"><core:Item key="{localmodel>knttp}" text="{localmodel>knttx}" /></ComboBox><Label text="Centro de costo"/><pc:InputValueHelp \n                            enabled="{= ${cartEntry>Knttp} === \'K\'}"\n                            id="idfragcentro2"\n                            placeholder="Selecciona un centro de costo"\n                            value="{cartEntry>Kostl}"\n                            showValueHelp="true"\n                            showSuggestion="true"\n                            helpModel="matchcode" \n                            helpEntitySet="ZCDSFI_CECO_TXT" \n                            helpDescriptionField="ltext" \n                            helpKeyField="kostl" \n                            text="{cartEntry>Kostl_Text}"\n                            dialogTitle="{i18n>centroCosto}"\n                        /><Label text="Cuenta"/><pc:InputValueHelp \n                            enabled="{= ${cartEntry>Knttp} === \'K\' || ${cartEntry>Knttp} === \'F\'}"\n                            id="idfragcuenta"\n                            placeholder="Selecciona una cuenta"\n                            value="{cartEntry>Saknr}"\n                            showValueHelp="true"\n                            showSuggestion="true"\n                            helpModel="matchcode" \n                            helpEntitySet="ZCDSFI_CUENTA_TXT" \n                            helpDescriptionField="txt20" \n                            helpKeyField="saknr" \n                            dialogTitle="{i18n>cuenta}"\n                        /><Label text="Número de orden"/><pc:InputValueHelp \n                            enabled="{= ${cartEntry>Knttp} === \'F\'}"\n                            id="idNumOrden"\n                            placeholder="Selecciona una orden"\n                            value="{cartEntry>Aufk}"\n                            showValueHelp="true"\n                            showSuggestion="true"\n                            helpModel="matchcode" \n                            helpEntitySet="ZCDSMM_AUFK_TXT"\n                            helpKeyField="aufnr"\n                            dialogTitle="{i18n>orden}"\n                        /><Label text="{i18n>activoFijo}"/><pc:InputValueHelp \n                            enabled="{= ${cartEntry>Knttp} === \'A\'}"\n                            id="idNumProyecto"\n                            placeholder="Selecciona un proyecto"\n                            value="{cartEntry>Anla}"\n                            showValueHelp="true"\n                            showSuggestion="true"\n                            helpModel="matchcode" \n                            helpEntitySet="ZCDSMM_ANLA_TXT"\n                            helpKeyField="anln1"\n                            helpDescriptionField="mcoa1"\n                            dialogTitle="{i18n>activoFijo}"\n                        /><Label text="Comentario"/><TextArea enabled="true" id="idfragcomentario" value="{cartEntry>Comentarios}" placeholder="Ingresa un comentario"\n\t\t\t\t\t\t\tgrowing="false" growingMaxLines="1" height="65px" width="100%"/></f:content></f:SimpleForm></l:content></l:Grid><buttons><Button id="idActualizar" visible="false" icon="sap-icon://accept" type="Transparent" text="Actualizar" press="pressActualizar"/><Button id="idAsignar" type="Transparent" icon="sap-icon://accept" text="Asignar" press="pressDetalleAsignar"/><Button id="idCancelar" type="Transparent" icon="sap-icon://decline" text="Cancelar" press="pressDetalleCancelar"/></buttons></Dialog></core:FragmentDefinition>',
