	"zsandiego/crearreserva/view/Product.view.xml":'<mvc:View controllerName="zsandiego.crearreserva.controller.Product"\n    xmlns:core="sap.ui.core" xmlns="sap.m" xmlns:mvc="sap.ui.core.mvc"><Page id="page" backgroundDesign="Solid"><landmarkInfo><PageAccessibleLandmarkInfo rootRole="Region" rootLabel="{i18n>Product_rootLabel}" contentRole="Main"\n\t\t\t\tcontentLabel="{i18n>Product_contentLabel}" headerRole="Region" headerLabel="{i18n>Product_headerLabel}" footerRole="Region"\n\t\t\t\tfooterLabel="{i18n>Product_footerLabel}"/></landmarkInfo><customHeader><Bar><contentLeft><Button type="Back" visible="{appView>/smallScreenMode}" press=".onBack"/></contentLeft><contentMiddle><Title level="H2" text="{i18n>num_Almacen}"/></contentMiddle><contentRight><ToggleButton icon="sap-icon://activity-items" pressed="{= ${appView>/layout}.startsWith(\'ThreeColumns\') }" tooltip="{i18n>toCartButtonTooltip}"\n\t\t\t\t\t\tpress=".onToggleCart" text="{ path: \'cartProducts>/cartEntries\', formatter: \'.formatter.countItems\' }"></ToggleButton></contentRight></Bar></customHeader><content><ObjectHeader title="{localmodel>/itemSelected/ItemName}" titleLevel="H3" ><attributes><ObjectAttribute title="{i18n>codigo}" text="{localmodel>/ProductData/ItemCode}"/><ObjectAttribute title="{i18n>productSupplierAttributeText}" text="{localmodel>/ProductData/WarehouseCode}"/><ObjectAttribute title="{i18n>cantidadMinima}" text="{localmodel>/ProductData/InStock}"/></attributes><statuses><ObjectStatus text="{ path : \'Status\', formatter : \'.formatter.statusText\' }"\n\t\t\t\t\t\tstate="{ path : \'Status\', formatter : \'.formatter.statusState\' }"/></statuses></ObjectHeader><VBox alignItems="Center" renderType="Div" width="90%"><Image id="productImage" src="{= ${productImagen>/Url_Imagen} !== \'\' ? ${productImagen>/Url_Imagen} : ${localmodel>/placeholder}}" decorative="true" densityAware="false" class="sapUiSmallMargin" width="100%"\n\t\t\t\t\theight="100%"><detailBox><LightBox id="lightBox"><imageContent><LightBoxItem imageSrc="{= ${productImagen>/Url_Imagen} !== \'\' ? ${productImagen>/Url_Imagen} : ${localmodel>/placeholder}}" title="{localmodel>Itetx}"/></imageContent></LightBox></detailBox></Image></VBox><VBox alignItems="Center" visible="{= ${localmodel>/Alternativos}.length > 0 ? true : false}" renderType="Div" width="90%"><List headerText="Lista de Alternativos ({= ${localmodel>/Alternativos}.length})" showNoData="false"></List><ScrollContainer vertical="true" focusable="true" height="25rem"><Table\n\t\t\t\t\tinset="false"\n\t\t\t\t\tfixedLayout="true"\n\t\t\t\t\titems="{ path : \'localmodel>/Alternativos\'}" ><columns><Column demandPopin="true" minScreenWidth="Tablet" popinDisplay="Inline" hAlign="Center"\n\t\t\t\t\t\t\twidth="15%"><Text text="Codigo Item" /></Column><Column demandPopin="true" minScreenWidth="Tablet" popinDisplay="Inline" hAlign="Center"\n\t\t\t\t\t\t\twidth="75%"><Text text="Descripción" /></Column></columns><items><ColumnListItem type="Navigation" press="onGetAlternativo" vAlign="Middle"><cells><ObjectIdentifier title="{localmodel>AlternativeItemCode}"  /><Text\n\t\t\t\t\t\t\t\t\ttext="{localmodel>itemObject}" /></cells></ColumnListItem></items></Table></ScrollContainer></VBox></content><footer><Toolbar><ToolbarSpacer/><Button enabled="{= ${localmodel>/ProductData/InStock} > 0 &amp;&amp; ${localmodel>/ProductData/NoexisteSeleccionado} ? true : false}" text="{i18n>addToCartShort}" icon="sap-icon://activity-items" type="Emphasized" press=".onAddToCart"/></Toolbar></footer></Page></mvc:View>',
